import React, { Component } from "react";

// Res
import logo from '../res/logo_habidom_seul.png';

class Appbar extends Component {
  render() {
    return (
      <div>
        <div className="logo">
           <img src={logo} alt="logo" /> 
        </div>

      </div>
    );
  }
}

export default Appbar;
